import { useContext } from "react";
import {productsContext} from '../../../context/product.context'
import {ProductCard} from '../../product-card/product-card.component'
const Shop = () => {
const {products}= useContext(productsContext)

    return (
      <div>
        {products.map(({id,name}) =>(
          <div key={id}>
            <h1>{name}</h1>
          </div>
        ))}
      </div>
    )
  
  };

  export default Shop
